syntax = "proto2";

package MMPro.micromsg;

import "BaseRequest.proto";
import "VoiceAttr.proto";

message CheckVoiceTransRequest {
	required BaseRequest _BaseRequest = 1;
	optional string _VoiceId = 2;
	required uint32 _TotalLen = 3;
	optional uint32 _MsgId = 4;
	optional VoiceAttr _VoiceAttr = 5;
	optional uint64 _NewMsgId = 6;
}
